import { Row, Container } from "reactstrap";
import './Navbar.css';
import './Navbar.scss';
import { Button, Nav, Navbar, NavDropdown } from 'react-bootstrap';

const NavbarComponent=() => {
    return (
        <Navbar bg="custom-color" expand="lg" fixed="top">
      <Container>
        <Navbar.Brand href="" className="text-white ">Tom & Journey logo</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
          <Nav className="justify-content-between">
            <Nav.Link href="" className="text-white font-weight-bold custom-size-1">Home</Nav.Link>
            <Nav.Link href="" className="text-white font-weight-bold custom-size-1">Trip Planner</Nav.Link>
            <Nav.Link href="" className="text-white font-weight-bold custom-size-1">Login</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    );
}

export default NavbarComponent;
